export default (function(a,b,c,d){return {data:{XS5gLULZZf:{data:{id:2600,attributes:{imdbId:"tt1509767",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTM3OTc2OTM2OF5BMl5BanBnXkFtZTcwMDM1MjU1NQ@@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"5.7\u002F10"},{Source:"Rotten Tomatoes",Value:"26%"},{Source:"Metacritic",Value:"35\u002F100"}],item_lang:{data:{id:3263,attributes:{title:b,plot:"After failing in a scheme to steal Leonardo Da Vinci's airship blueprints, the Musketeers are disbanded by Cardinal Richelieu leaving Athos, Porthos and Aramis on the streets of Paris. In the meantime, the young, reckless and ambitious D'Artagnan has set off from Gascony with dreams of becoming a musketeer himself, not realizing that they have been disbanded. In no time, D'Artagnan manages to offend Athos, Porthos and Aramis on different occasions and challenges them all to duels. However before the duels can take place they are attacked by guards, trying to arrest them for illegal dueling. The ex-musketeers and D'Artagnan fight off the soldiers, leading to the four men becoming a band with the motto of \"All for one, and one for all\". Count Richelieu is not only determined to be rid of the musketeers, but also schemes with Athos' former lover Milady to undermine the reign of King Louis and his wife. The musketeers and D'Artagnan are determined to save the royal family and France itself.",slug:"the-three-musketeers"}}},books:{data:[{id:1613,attributes:{title:"Three Musketeers",description:"In Alexandre DumasÍs classic tale of the adventure,ædÍArtagnan has gone to Paris to make his fortune and join the kingÍs Musketeers. Along the way, he encounters, fights, and befriends three Musketeers and joins their fight to protect the queen from the Cardinal. æLove, honor, and friendships are tested in the Calico Illustrated Classics adaptation of DumasÍs The Three Musketeers.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=bgV7AgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[c],firstBook:true,published:"2010-09-01",publisher:"ABDO Publishing Company",subtitle:a}},{id:1614,attributes:{title:b,description:"It's \"one for all and all for one!\" as D'Artagnan and his three pals follow a course of swashbuckling intrigue and adventure in 17th-centry France.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=BIOjqbLWoJgC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[c],firstBook:d,published:"2004-09-28",publisher:"Bantam Classics",subtitle:a}},{id:1615,attributes:{title:b,description:"One of the preeminent novels by French writer Alexandre Dumas, this swashbuckling tale follows a group of honorable 17th-century swordsmen who must contend with powerful adversaries scheming against the queen. Determined to join the royal guard, young d'Artagnan leaves his country home and travels to Paris, where he unintentionally angers Aramis, Athos, and Porthos, the esteemed Three Musketeers. Eventually winning the trust and admiration of the formidable trio of fighters, d'Artagnan joins them in their quest to thwart the plans of the sinister Cardinal Richelieu.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=KW0YAAAAYAAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[c],firstBook:d,published:"1878-01-01",publisher:a,subtitle:a}},{id:1616,attributes:{title:b,description:"A historical romance, this novel tells of the adventures of the hot-headed young Gascon, d'Artagnan and his three companions Athos, Porthos and Aramis as they gallantly defend the Queen of France, using their wit and their swords. Set in the seventeenth century.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=zC8JzgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:d,published:"1844-03-01",publisher:a,subtitle:"3 Musketeers Alexandre Dumas Book"}},{id:1617,attributes:{title:b,description:"In seventeenth-century France, young D'Artagnan joins three musketeers to outwit the enemies of the king",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=CEMg5yJPm-YC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[c,"Alan Weissman","John Green"],firstBook:d,published:"1994-01-01",publisher:"Courier Corporation",subtitle:a}}]}}},meta:{}}},prerenderedAt:1680940909639}}("","The Three Musketeers","Alexandre Dumas",null))